import './App.css';
import { useState } from 'react';
import Password from './passowrd';

function App() {

  const [delta,setDelta] = useState()
  const [passVal,setPass] = useState('')

  function ChangeNumber(event){
    console.log(event);
    setDelta(Number(event.target.value))
  }

  function setPassowrd(pass){
    setPass(pass)
  }


  return (
    <div className="App">
      <input type = "number" value={delta} onChange = {ChangeNumber}/>
      <button>submit</button>
      <p></p>
      PASSORD IS {passVal}
      <Password  passVal = {passVal} setPassowrd = {setPassowrd}></Password>
    </div>
  );
}

export default App;
